import React from 'react';

const styles = {
  box: {
    color: 'red',
  },
};
export default function Global({ stats }) {
  return (
    <>
      <div style={styles.box}>
        <p>Confirmed: {stats.confirmed.value}</p>
      </div>
      <div style={styles.box}>
        <p>Recovered: {stats.recovered.value}</p>
      </div>
      <div style={styles.box}>
        <p>Deaths: {stats.deaths.value}</p>
      </div>
    </>
  );
}
